import React from 'react';
import Home from './components/Home';
import Welcome from './Welcome';
import App from './App';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

const Routes =()=>{
    return(
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={Welcome} />

        </Switch>
    </BrowserRouter>);
};
export default Routes;
